import React from 'react';
import './App.css';
import SearchBox from "./SearchBox"
import CardList from "./CardList"
import {robots} from "./robots"

function App() {
  return (
    <div className="tc">
    <h1>RoboFriends</h1>
    <SearchBox/>
    <CardList robots={robots}/>
</div>
  );
}

export default App;
